import React, { useState } from "react";
import { processColor, Text, Dimensions, StatusBar } from "react-native";
import styled from "styled-components/native";

import Platform from "./Platform";

import G from "./assets/G";
import N from "./assets/N";
import L from "./assets/L";
import C from "./assets/C";

const colors = {
  black: "#010202",
  cyan: "#29AAE2",
  magenta: "#E32185",
  yellow: "#FAEA26",
};

const letters = {
  g: {
    component: <G as={Letter} />,
    color: colors.black,
    backgroundColor: colors.cyan,
  },
};

const Container = styled.View`
  display: flex;
  flex: 4;
  flex-direction: ${(props) =>
    props.orientation === "landscape" ? "row" : "column"};
  align-items: stretch;
  justify-content: center;
  z-index: 0;
`;

const Row = styled.View`
  background-color: ${(props) => props.backgroundColor};
  flex: 1;
  overflow: hidden;
  align-items: ${(props) =>
    props.orientation === "landscape" ? "center" : "stretch"};
  justify-content: center;
  z-index: ${(props) => props.zIndex};
`;

const Letter = styled.View``;

Dimensions.addEventListener("change", () => {});

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      orientation: Platform.isPortrait() ? "portrait" : "landscape",
      devicetype: Platform.isTablet() ? "tablet" : "phone",
    };

    Dimensions.addEventListener("change", () => {
      this.setState({
        orientation: Platform.isPortrait() ? "portrait" : "landscape",
      });
    });
  }

  render() {
    const { orientation } = this.state;
    return (
      <Container orientation={orientation}>
        <StatusBar hidden />
        {Object.keys(letters).map((key, i) => {
          if (typeof Components[block.component] !== "undefined") {
            return React.createElement(Components[key.component], {
              key: i,
              color: key.color,
              backgroundColor: key.backgroundColor,
            });
          }
          return <Key.component />;
        })}
        <Row
          orientation={orientation}
          zIndex={10}
          backgroundColor={colors.cyan}
        >
          <G as={Letter} color={processColor(colors.black)} />
        </Row>
        <Row
          orientation={orientation}
          zIndex={20}
          backgroundColor={colors.magenta}
        >
          <N as={Letter} color={processColor(colors.cyan)} />
        </Row>
        <Row
          orientation={orientation}
          zIndex={30}
          backgroundColor={colors.yellow}
        >
          <L as={Letter} color={processColor(colors.magenta)} />
        </Row>
        <Row
          orientation={orientation}
          zIndex={40}
          backgroundColor={colors.black}
        >
          <C as={Letter} color={processColor(colors.yellow)} />
        </Row>
      </Container>
    );
  }
}

export default App;
